Program: |+1
 // Method Tasks:
 // calculate the distance between the straight defined by  A and B
 // and C
 //
 // Parameters	: A, the coordinate of point A
 //				  B, the coordinate of point B
 //				  C, the coordinate of pount C
 //
 // ReturnValues: the distance
 //
 // Called By	: External
 // Calls		: none
 //--------------------------------------------------------------------------------
 
 param  A, B, C : real[3]  -> real
 
 
 var FP : real[3] := calcDroppedPerpendicularFootPoint(A, B, C)
 // calculate the distance
 var d : real := (c-FP).magnitude
 
 
 result := d
